import React from 'react'

const Help2 = () => {
  
  let demo = (a)=>{
    console.log(a);
  }
  return (
    <>
        <div className='container' style={{minHeight : "650px"}}>
            <button onClick={()=>demo("rohit")} className='btn btn-info'>OK</button>
        </div>
    </>
  )
}

export default Help2
